import uuid from 'uuid';

export default class Cities extends Component {
  state = {
    cities: [
      { id: uuid(), name: 'Chelsea'},
      { id: uuid(), name: 'Greenpoint'},
      { id: uuid(), name: 'Bushwick'},
      { id: uuid(), name: 'LIC'},
    ]
  }
  render() {
    const { cities } = this.state;
    return (
      <Container>
        <Button color="dark" >Add City</Button>
